import React from 'react';
import {BrowserRouter} from 'react-router-dom';
import CtrlRouter from '../shared/CtrlRouter';
import Lecture from '../pages/Lecture';

const Root = () => (
    <BrowserRouter>
        <CtrlRouter></CtrlRouter>
        <Lecture></Lecture>
    </BrowserRouter>
);

export default Root;
